---
layout: default
---


<h2>{{ page.title }}</h2>

<h3>This video has not yet been made, but is hopefully coming soon</h3>

<nav id="pages"> 
		<div class="pagePrevious"> 
		{% if page.previous.url %} 
				<a href="{{page.previous.url}}" title="Previous Post: {{page.previous.title}}">&laquo; {{page.previous.title}}</a> 
		{% endif %} 
		</div> 

		<div class="pageNext"> 
		{% if page.next.url %} 
				<a href="{{page.next.url}}" title="next Post: {{page.next.title}}">{{page.next.title}} &raquo; </a> 
		{% endif %} 
		</div> 
</div> 

<link href="https://google-code-prettify.googlecode.com/svn/loader/prettify.css" type="text/css" rel="stylesheet" />

<script type="text/javascript" src="https://google-code-prettify.googlecode.com/svn/loader/prettify.js"></script>
<script type="text/javascript" src="//ajax.googleapis.com/ajax/libs/jquery/1.10.2/jquery.min.js"></script>
<script type="text/javascript" src="http://popcornjs.org/code/dist/popcorn-complete.min.js"></script>

<script type="text/javascript">

	var page = {
		'vimeoURL': '{{page.vimeoURL}}'
	};

</script>


<script type="text/javascript" src="/js/annotations.js"></script>
